import {useEffect, useState} from "react";


const ReviewList = () => {
    const [files, setFiles] = useState([]);
    let [user, setUser] = useState([]);

    useEffect(() => {
        const ifUser = localStorage.getItem("userCookie");
        if (ifUser) {
            setUser(JSON.parse(ifUser));
        }
    }, [])

    const handleFileChange = (e) => {
        const newFiles = [...e.target.files];
        setFiles(newFiles);
    }

    const imgPreview = files.map((img, i) => {
        return(
            <>
               <img key={i} src={URL.createObjectURL(img)} style={{height:"200px", width:"200px"}} onClick={() => {deleteHandler(img)}} />
               &nbsp;
            </>
        )
    })

    const deleteHandler = (img) => {
        let currentIdx = files.indexOf(img);
        let newFiles = [...files];
        newFiles.splice(currentIdx, 1);
        setFiles(newFiles);
    }

    const submitHandler = () => {

